import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { ApolloProviderWrapper } from './apolloClient';
import UserList from './components/UserList';
import HotelList from './components/HotelList';
import RoomList from './components/RoomList';
import RoomTypeList from './components/RoomTypeList';
import BookingList from './components/BookingList';
import './App.css';

const images = [
  '/icon/Picture_1.png',
  '/icon/Picture_2.png',
  '/icon/Picture_3.png',
  '/icon/Photo 1.png',
  '/icon/Photo 3.png',
];

const App = () => {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  const prevImage = () => {
    setCurrentImageIndex((prevIndex) => (prevIndex === 0 ? images.length - 1 : prevIndex - 1));
  };

  const nextImage = () => {
    setCurrentImageIndex((prevIndex) => (prevIndex === images.length - 1 ? 0 : prevIndex + 1));
  };

  return (
    <ApolloProviderWrapper>
      <Router>
        <div className="App">
          <nav>
            {<ul>
              <li>
                <Link to="/users">
                  <img src="/images/users-icon.png" alt="Users" />
                  <span>Users</span>
                </Link>
              </li>
              <li>
                <Link to="/hotels">
                  <img src="/images/hotels-icon.png" alt="Hotels" />
                  <span>Hotels</span>
                </Link>
              </li>
              <li>
                <Link to="/rooms">
                  <img src="/images/rooms-icon.png" alt="Rooms" />
                  <span>Rooms</span>
                </Link>
              </li>
              <li>
                <Link to="/room-types">
                  <img src="/images/room-types-icon.png" alt="Room Types" />
                  <span>Room Types</span>
                </Link>
              </li>
              <li>
                <Link to="/bookings">
                  <img src="/images/bookings-icon.png" alt="Bookings" />
                  <span>Bookings</span>
                </Link>
              </li>
            </ul>}
          </nav>

          <main>
            <Routes>
        <Route path="/users" element={<UserList />} />
        <Route path="/hotels" element={<HotelList />} />
        <Route path="/rooms" element={<RoomList />} />
        <Route path="/room-types" element={<RoomTypeList />} />
        <Route path="/bookings" element={<BookingList />} />
        <Route path="/" element={<div className="WelcomeSection1"><h1>Welcome to the Hotel Booking System</h1></div>} />
            </Routes>
          </main>
          <div className="WelcomeSection">
    <img
      src="/icon/left-c.png"
      alt="Previous"
      onClick={prevImage}
      className="navButton leftButton"
    />
    <h1>Welcome to the Hotel Booking System</h1>
    <img
      src="/icon/right-c.png"
      alt="Next"
      onClick={nextImage}
      className="navButton rightButton"
    />
    <div className="backgroundImages">
      {images.map((image, index) => (
        <img
          key={index}
          src={image}
          alt={`Background ${index}`}
          className={index === currentImageIndex ? "active" : ""}
        />
      ))}
    </div>
  </div>
        </div>
      </Router>
    </ApolloProviderWrapper>
  );
};

export default App;
